INSERT INTO `EvaluationFormStep` VALUES (1,'published',1,'3673a855-5f81-40c5-a61b-8a2198620107','2023-11-18 01:33:55','3673a855-5f81-40c5-a61b-8a2198620107','2023-11-18 01:39:40','Stärken','Die Fragen dienen dazu, die persönlichen Stärken einer Person aufgrund ihrer eigenen Selbsteinschätzung zu ermitteln und bieten Einblicke in ihre Werthaltung und Vorlieben. Ein Persönlichkeitstest wird zusätzlich verwendet, um die Stärken genauer zu analysieren und ein umfassenderes Bild der individuellen Persönlichkeit zu zeichnen.'),(2,'published',2,NULL,NULL,'3673a855-5f81-40c5-a61b-8a2198620107','2023-11-18 02:11:14','Persönliche Werte','Unsere Werte sind tief verwurzelte Überzeugungen und Prinzipien, die das Verhalten und die Entscheidungen einer Person leiten. Es ist wichtig, sie zu kennen, da sie als innerer Kompass dienen und helfen,'),(3,'published',3,NULL,NULL,'3673a855-5f81-40c5-a61b-8a2198620107','2023-11-18 02:10:58','Der ideale Arbeitsrahmen','Ein Arbeitsrahmen, der den eigenen Bedürfnissen entspricht, fördert die persönliche Zufriedenheit und das Wohlbefinden am Arbeitsplatz, da er eine angenehme und produktive Arbeitsumgebung schafft. Bei der Berufswahl ist es wichtig, diesen Rahmen zu berücksichtigen, um sicherzustellen, dass der gewählte Beruf und die Arbeitsbedingungen den individuellen Anforderungen und Vorlieben gerecht werden.'),(4,'published',4,NULL,NULL,'3673a855-5f81-40c5-a61b-8a2198620107','2023-11-18 02:11:07','Finanzierungsmöglichkeiten','Die Fragen zur Prüfung des Anspruchs auf einen Bildungsgutschein dienen dazu, die individuellen Bildungsbedürfnisse und beruflichen Ziele einer Person zu ermitteln. Dies ermöglicht es, festzustellen, ob sie berechtigt ist, staatliche Unterstützung für die Finanzierung ihrer Weiterbildung oder Umschulung zu erhalten.');
